using Common;
using Common.Resources.Proto;
using Common.Utils;
using ProtoBuf;

namespace PemukulPaku.GameServer.Handlers
{
    [PacketCmdId(CmdId.GetConfigReq)]
    internal class GetConfigReqHandler : IPacketHandler
    {
        public void Handle(Session session, Packet packet)
        {

            MemoryStream ms = new(Misc.StringToByteArray(""));
            GetConfigRsp Rsp = Serializer.Deserialize<GetConfigRsp>(ms)!;

            Rsp.ServerCurTime = (uint)Global.GetUnixInSeconds();
            Rsp.RegionName = Global.config.Gameserver.RegionName;
            Rsp.NextDayBeginTime = (uint)Global.GetUnixInSeconds() + 604800 / 7;

            session.Send(Packet.FromProto(Rsp, CmdId.GetConfigRsp));
        }
    }
}
